d:      .zero 16384
T1:     .zero 16384
T2:     .zero 16384
alpha: 	.word 1
beta:   .word 1
N:      .word 64

.text
        la  s1, a
        la  s2, b
        la  s3, c
        la  s4, d
        la  s5, T1
        la  s6, T2
        lw  s7, alpha
        lw  s8, beta
        lw  s9, N

        # Preliminary part: ... #

        # for(i=0,...,...){ #
        addi t0, zero, 4
        mul a3, s9, t0   # a3 -> 4*N 
        add  t1, zero, zero
        
        add a0, zero, s2 #Follows B
        add a1, zero, s6 #Follows T2
iloop:
        # for(j=0,...,...){ #Go column first
        add t2, zero, zero  #Tracks j
jloop:        
        lw t4, 0(a0) #Get value from B
        sw t4, 0(a1) #Save it to T2
        
        # for(...,...,j++)
        addi t2, t2, 1
        add a0,a0,t0 #go to next B column
        
        add t3,zero,s9
        mul t3,t3,t0 #go to next T2 row
        add a1,a1,t3
        
        # for(...,j<size,...) #Check if we have finished transposing a row
        blt t2, s9, jloop
        
        #if so make both go to beggining
        add a0, zero, s2
        add a1, zero, s6
        
        #update i
        addi t1,t1,1
                
        #Use t2 as aux, will reset to zero shortly anyway
        #B goes to right row
        add t2,zero,a3 #t2 -> 4*N
        mul t2,t2,t1   #t2 -> 4*N*i
        add a0,a0,t2   #B row = i
        
        #T2 goes to right column
        add t2,zero,t0 #t2 -> 4
        mul t2,t2,t1   #t2 -> 4*i
        add a1,a1,t2   #C column = i
        
        # for(...,i<size,...); Check if operation is done
        blt t1, s9, iloop
        
        # First part: T1 = A*B #

        # Initialization of auxiliaries:
        addi t0, zero, 4 #
        mul a3, s9, t0   # a3 -> 4*N
        add a0, zero, s1 # a0 -> *A
        add a1, zero, s6 # a1 -> *T2 
        add t0, zero, a1 # t0 -> *auxT2 = T2
        add a2, zero, s4 # a2 -> *D
        add a4, zero, s3 # a4 -> *C
        add a5, zero, zero #Counter
        addi a6,zero,4 #Compute a6 by a6 "squares"
        
        #s10 -> a6 * N
        #s11 -> N/a6
        
        mul s10, s9, a6 #Number of calculated elements before reaching end of rows
        div s11, s9, a6 #Number of previously defined rows to be done
        
        add a7, zero, a6 #a7 used to go back up rows
        mul a7, a7, a3 
        addi a6, a6, -2 #To compare with counter a5

        # for(i=0,...,...){ #Everything normal here
        add t1, zero, zero
f1loop1:
        # for(j=0,...,...){
        add t2, zero, zero
f1loop2:
        # for(k=0,...,...){
        add t3, zero, zero
        # aux1 = 0
        add t4, zero, zero
f1loop3:
        # ... += A[i][k] * ...
        lw t5, 0(a0)
        # ... += ... * B[k][j]
        lw t6, 0(t0)
        # ... += A[i][k] * B[k][j]
        mul t5, t5, t6 
        # aux1 += A[i][k] * B[k][j]
        add t4, t4, t5
        # A++
        addi a0, a0, 4
        # auxT2 += 4 (moves to the next column)
        addi t0, t0, 4
        # for(...,...,k++)
        addi t3, t3, 1 
        # for(...,k<N,...)
        blt t3, s9, f1loop3
        # }
        
        lw t0, 0(a4) #Get from C
        mul t0,t0,s8 #Multiply by beta
        
        mul t4,t4,s7 #Mutiply by alpha right away
        add t4,t0,t4 #C[i,j]*beta + T1[i,j]*alpha (T1 just to indicate the value) 
                     #We are not using it to store                       
        
        sw t4, 0(a2) #Save the value
        
        bgt a5, a6,  up #See figure in lab for example
                        #Every a6 elements calculated we go up
        
        #If not going up, then D and C next column
        add a2, a2, a3
        add a4, a4, a3
        
        # A, do nothing, we are were we want to be
        # T2, just need to fix t0, i.e. reset to beggining of row

        # auxT2 = T2
        add  t0, zero, a1
        
        addi a5, a5, 1 #Update counter
        
        jal notup #Always jump to notup
                  
up:        
        #Just updating C and D to correct places
        #Some big adjustments needed (see figure)
        sub a2, a2, a7 #Go up a6-1 rows
        add a2, a2, a3 
        addi a2, a2, 4 #And move to next column
                 
        sub a4, a4, a7
        add a4, a4, a3        
        addi a4, a4, 4
        
        sub a0, a0, a7 #Adjust A (go back up a6 rows)
        
        add a1, a1, a3 #T2 goes to next row
        add t0, zero, a1 
        
        addi a5, zero, 0 #Reset counter
        
notup:
        # for(...,...,j++) Check if we are done, (N*a6 cycles)
        addi t2, t2, 1
        # for(...,j<N,...)
        blt t2, s10, f1loop2
        # }
        
        #So basically we have finished the a6 rows
        #Now we need to move down to the next set
        
        add a1, zero, s6 #Reset T2
        add t0, zero, a1
        
        #Notice how in the last element of any row we would "go up" next
        #But this would take us out of the matrix now
        #So we need to revert everything up does
        
        add a0,a0,a7 #Revert what up does to A and we are good 
        
        add a2,a2,a7 #Revert what up does to C and D
        sub a2,a2,a3 #Except the add 4, that we want, to go to next row easily
        
        add a4,a4,a7
        sub a4,a4,a3        
            
        # for(...,...,i++) Check if we are done, (N/a6 cycles)
        addi t1, t1, 1
        # for(...,i<N,...)
        blt t1, s11, f1loop1
        # }

        # return
        li a7, 10
        ecall